const fieldSizeInches = 144;
const fieldImagePixels = 600;

const styles = {
  pathlines: {
    width: fieldImagePixels,
    height: fieldImagePixels,
    position: "absolute",
    inset: 0,
    pointerEvents: "none",
    zIndex: 0,
  },
};

export default styles;
